class Solution:
    # @param A, a list of integers
    # @return a boolean
    def canJump(self, A):        
        target = len(A) - 1
        if target < 0:
            return False

        last = 0
        for i in range(len(A)):
            if last < i+A[i]:
                last = i+A[i]
            if last >= target:
                return True
            if last <= i:
                return False


